// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "./ConvertLib.sol";

contract MetaCoin {
    mapping(address => uint) balances;
    address public owner;

    event Transfer(address indexed _from, address indexed _to, uint256 _value);

    constructor() {
        // Set the contract deployer as the owner
        owner = msg.sender;

        // Mint initial coins to the contract creator
        mint(msg.sender, 10000);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    function sendCoin(address receiver, uint amount) public returns (bool sufficient) {
        if (balances[msg.sender] < amount) return false;
        balances[msg.sender] -= amount;
        balances[receiver] += amount;
        emit Transfer(msg.sender, receiver, amount);
        return true;
    }

    function getBalanceInEth(address addr) public view returns (uint) {
        return ConvertLib.convert(getBalance(addr), 2);
    }

    function getBalance(address addr) public view returns (uint) {
        return balances[addr];
    }

    // Mint function to create new coins and assign them to a receiver
    function mint(address receiver, uint amount) public onlyOwner {
        balances[receiver] += amount;
        emit Transfer(address(0), receiver, amount); // Emit a transfer event from address(0) to signify minting
    }
}
